import React from 'react';
import { Box, Heading } from 'grommet';

const landing = props => {
  return (
    <React.Fragment>

      <Box height="40%">
        <Heading color="dark-1" size="small" margin="medium">Find places to eat in:</Heading>
      </Box>

      <Box height="60%">
        <Heading color="status-warning" size="large" margin="medium" textAlign="center">{props.location}</Heading>
      </Box>

    </React.Fragment>
  )
}

export default landing;
